    # Clear both Question and Solution boards
    def Clear(self):
        self.QsNum.setText("")
        for i in range(1,10):
            for j in range(1,10):
                temp_write = QtWidgets.QTextEdit.findChild(self.frame_SolBoard, QtWidgets.QTextEdit, "sol_"+str(i)+str(j))
                temp_write.setText("")
                temp_write = QtWidgets.QTextEdit.findChild(self.frame_QsBoard, QtWidgets.QTextEdit, "qs_"+str(i)+str(j))
                temp_write.setText("")
    
    # Read Question and Solution from database with specified Question Number
    def Database(self):
        DatabaseMode = True
        ReplaceMode = False
        ReadMode = True
        client_address, collection_name, db_name, question_num, question_board, solution = self.set_common_variables()
        question_board, solution = SudokuWDatabase.main(DatabaseMode, ReadMode, ReplaceMode, client_address, collection_name, db_name, question_num, question_board, solution)
        for i in range(1,10):
            for j in range(1,10):
                temp_write = QtWidgets.QTextEdit.findChild(self.frame_SolBoard, QtWidgets.QTextEdit, "sol_"+str(i)+str(j))
                temp_write.setText(solution[i-1][j-1])
                temp_write = QtWidgets.QTextEdit.findChild(self.frame_QsBoard, QtWidgets.QTextEdit, "qs_"+str(i)+str(j))
                temp_write.setText(question_board[i-1][j-1])
        
    # Take input from Question board
    # Generate solution and output to Solution board
    # DO NOT save to database
    def GetSol(self):
        DatabaseMode = False
        ReplaceMode = False
        ReadMode = False
        #solution = [[] for i in range(9)]
        client_address, collection_name, db_name, question_num, question_board, solution = self.set_common_variables()
        solution = SudokuWDatabase.main(DatabaseMode, ReadMode, ReplaceMode, client_address, collection_name, db_name, question_num, question_board, solution)
        for i in range(1,10):
            for j in range(1,10):
                temp_write = QtWidgets.QTextEdit.findChild(self.frame_SolBoard, QtWidgets.QTextEdit, "sol_"+str(i)+str(j))
                temp_write.setText(solution[i-1][j-1])
    
    # Take input from Question board
    # Generate solution and output to Solution board
    # Save to database
    def NewEntry(self):
        match self.Box_Overwrite.checkState():
            case 0:
                ReplaceMode = False
            case 2:
                ReplaceMode = True
            case _:
                ReplaceMode = False
        DatabaseMode = True
        ReadMode = False
        client_address, collection_name, db_name, question_num, question_board, solution = self.set_common_variables()
        SudokuWDatabase.main(DatabaseMode, ReadMode, ReplaceMode, client_address, collection_name, db_name, question_num, question_board, solution)
        
    def readQSBoard(self):
        QSBoard_loaded = [[] for i in range(9)]
        for i in range(1,10):
            for j in range(1,10):
                temp_read = QtWidgets.QTextEdit.findChild(self.frame_QsBoard, QtWidgets.QTextEdit, "qs_"+str(i)+str(j))
                temp_text = temp_read.toPlainText()
                temp_num = int(temp_text if temp_text.isnumeric() else 0)
                if temp_num not in range(1,10):
                    QSBoard_loaded[i-1].append(".")
                else:
                    QSBoard_loaded[i-1].append(temp_text)
        return QSBoard_loaded

